import { connect } from 'react-redux';

import { loaduser } from '../../redux/Actions/userActions';
class HomeScreen extends Component {


    unsubscirbe = null
    componentDidMount() {
        this.unsubscirbe = async () => {
            await this.props.loaduser()
        }
        this.unsubscirbe();
    }
    componentWillUnmount() {
        return this.unsubscirbe;
    }

    render() {

        return (
            <div>
                <h1> welcome Home</h1>
            </div>
        )
    }
}



export default connect(null, { loaduser })(HomeScreen);
